    { id: 2, name: "Jane Smith", place: "Los Angeles", phoneNumber: "9876543210", emailId: "jane@example.com", baseAmount: 250.75 }
  ];

  return (
    <div className="App">
      <CustomersTable customers={customers} />
    </div>
  );
};

export default App;
